import React from "react";
import logo from "../src/Images/logo.png";
import "./App.css";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";





function App() {
  return (
    <div className="navbar">
      <Link to="/">
        <a href="#">Home</a>
      </Link>

      <Link to="/ViewTemplates">
        <a href="#">View Templates</a>
      </Link>
      <Link to="/login">
        <a href="#">Log In</a>
      </Link>
      <Link to="/signup">
        <a href="#">Sign Up</a>
      </Link>
    </div>
  );

}

export default App;
